import React, { useState } from "react";
import { TextField, Box, FormControl, InputLabel, Select, MenuItem, Typography, Button } from "@mui/material";

import { styled } from "@mui/system";
import { useFormik } from "formik";
import { Link } from "@mui/material";
import { GoogleMap, LoadScript } from "@react-google-maps/api";

const Profile = () => {
  const [values, setValues] = useState({
    name: "",
    username: "",
    email: "",
    interests: "",
    location: "",
    billingInfo: "",
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setValues({ ...values, [name]: value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle form submission logic
  };

  return (
    <Box
      sx={{
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        minHeight: '100vh',
        backgroundImage: "linear-gradient(to right, rgba(132, 250, 176, 0.5), rgba(143, 211, 244, 0.5))",
      }}
    >
      <Box sx={{ width: '100%', maxWidth: 550, backgroundColor: 'white', padding: '2rem', margin: ".5rem", borderRadius: '15px' }}>
        <Typography variant="h4" sx={{ marginBottom: '1.5rem' }}>Profile</Typography>
        <form onSubmit={handleSubmit} style={{ display: 'flex', flexDirection: 'column' }}>
          <Box sx={{ display: 'flex', flexDirection: 'column', marginBottom: '1rem' }}>
            <InputLabel htmlFor="name" sx={{ alignSelf: 'start' }}>Name</InputLabel>
            <FormControl fullWidth>
              <TextField
                id="name"
                name="name"
                variant="outlined"
                value={values.name}
                onChange={handleChange}
              />
            </FormControl>
          </Box>
          <Box sx={{ display: 'flex', flexDirection: 'column', marginBottom: '1rem' }}>
            <InputLabel htmlFor="username" sx={{ alignSelf: 'start' }}>Username</InputLabel>
            <FormControl fullWidth>
              <TextField
                id="username"
                name="username"
                variant="outlined"
                value={values.username}
                onChange={handleChange}
              />
            </FormControl>
          </Box>
          <Box sx={{ display: 'flex', flexDirection: 'column', marginBottom: '1rem' }}>
            <InputLabel htmlFor="email" sx={{ alignSelf: 'start' }}>Email</InputLabel>
            <FormControl fullWidth>
              <TextField
                id="email"
                name="email"
                variant="outlined"
                value={values.email}
                onChange={handleChange}
              />
            </FormControl>
          </Box>
          <Box sx={{ display: 'flex', flexDirection: 'column', marginBottom: '1rem' }}>
            <InputLabel htmlFor="interests" sx={{ alignSelf: 'start' }}>Interests</InputLabel>
            <FormControl fullWidth>
              <Select
                id="interests"
                name="interests"
                value={values.interests}
                onChange={handleChange}
                variant="outlined"
              >
                <MenuItem value="Food">Food</MenuItem>
                <MenuItem value="Fashion">Fashion</MenuItem>
              </Select>
            </FormControl>
          </Box>
          <Box sx={{ display: 'flex', flexDirection: 'column', marginBottom: '1rem' }}>
            <InputLabel htmlFor="location" sx={{ alignSelf: 'start' }}>Location</InputLabel>
            <Box>
              <iframe
                title="Google Map"
                width="100%"
                height="300"
                frameBorder="0"
                style={{ border: 0 }}
                src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3888.1686957630477!2d-77.0368704851609!3d38.907192081767846!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x89b7b7bcdecbb1df%3A0x715969d3f4b7e61b!2sWhite%20House!5e0!3m2!1sen!2sus!4v1633573829779!5m2!1sen!2sus"
                allowFullScreen
              ></iframe>
            </Box>
          </Box>
          <Box sx={{ display: 'flex', flexDirection: 'column', marginBottom: '1rem' }}>
            <InputLabel htmlFor="billingInfo" sx={{ alignSelf: 'start' }}>Billing Info</InputLabel>
            <FormControl fullWidth>
              <TextField
                id="billingInfo"
                name="billingInfo"
                variant="outlined"
                value={values.billingInfo}
                onChange={handleChange}
              />
            </FormControl>
          </Box>
          <Button type="submit" variant="contained" color="primary">Save</Button>
        </form>
      </Box>
    </Box>
  );
};

export default Profile;
